class Solution {
public:
    int maxEvents(vector<vector<int>>& events) {
        sort(events.begin(), events.end(), [](vector<int> &a, vector<int> &b){
            return a[1] < b[1];
        });
        int n = events.size();
        priority_queue<int, vector<int>, greater<int>> pq;
        int res = 0;
        for(int i = 0; i < n; i++){
            while(!pq.empty() && pq.top() < events[i][0]){
                pq.pop();
            }
            pq.push(events[i][1]);
            while(!pq.empty() && pq.top() < events[i][0]){
                pq.pop();
            }
            res++;
            pq.pop();
        }
        return res;
    }
};
