class Solution {
public:
    int maxEvents(vector<vector<int>>& events) {
        sort(events.begin(), events.end(), [](const vector<int>& a, const vector<int>& b) {
            return a[0] < b[0];
        });
        int n = events.size();
        int ans = 0;
        int i = 0;
        while (i < n) {
            int j = i;
            while (j < n && events[j][0] <= events[i][1]) {
                events[j][1] < events[i][1] ? j++ : i++;
            }
            ans++;
            i = j;
        }
        return ans;
    }
};
